import React, { Component } from "react";
import { GridList, Container, Grid } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h2>Cart</h2>
        <GridList
          cellHeight={100}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow"].map(color => (
            <Grid direction="row" style={{ background: color }}>
              <h3>Product name</h3>
              <Container>
                <h3>Product name</h3>
                <h3>Product name</h3>
              </Container>
            </Grid>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;
